    {
      "lineNumber": 89691,
      "originalJapaneseLine": "「死ね」",
      "translatedEnglishLine": "\"Die.\""
    },
    {
      "lineNumber": 89692,
      "originalJapaneseLine": "「おお……相変わらずキツいぞ、アタゴちゃん……」",
      "translatedEnglishLine": "\"Oh... as harsh as ever, Atago-chan...\""
    },
    {
      "lineNumber": 89693,
      "originalJapaneseLine": "「ああ、ランス様、",
      "translatedEnglishLine": "\"Ah, Lord Rance,"
    },
    {
      "lineNumber": 89694,
      "originalJapaneseLine": "　やっぱりここにいらしたんですね」",
      "translatedEnglishLine": "So you really were here after all.\""
    },
    {
      "lineNumber": 89695,
      "originalJapaneseLine": "「む、どうした？」",
      "translatedEnglishLine": "\"Hmm, what’s the matter?\""
    },
    {
      "lineNumber": 89696,
      "originalJapaneseLine": "「軍師の皆さんがご相談があるそうで、",
      "translatedEnglishLine": "\"The strategists say they have something to discuss,"
    },
    {
      "lineNumber": 89697,
      "originalJapaneseLine": "　お城まで戻って頂けますか？」",
      "translatedEnglishLine": "Could you please return to the castle?\""
    },
    {
      "lineNumber": 89698,
      "originalJapaneseLine": "「まったく、なんなんだ？",
      "translatedEnglishLine": "\"Really, what’s going on?"
    },
    {
      "lineNumber": 89699,
      "originalJapaneseLine": "　人が楽しく飲んでる時に」",
      "translatedEnglishLine": "When people are having fun drinking!\""
    },
    {
      "lineNumber": 89700,
      "originalJapaneseLine": "「アタゴさんも、いつもいつもすみません」",
      "translatedEnglishLine": "\"Atago-san, I’m sorry as always.\""
    },
    {
      "lineNumber": 89701,
      "originalJapaneseLine": "「ああ、いいのいいの。",
      "translatedEnglishLine": "\"Ah, it’s fine, it’s fine."
    },
    {
      "lineNumber": 89702,
      "originalJapaneseLine": "　これくらい慣れっこだから」",
      "translatedEnglishLine": "I’m used to this much by now.\""
    },
    {
      "lineNumber": 89703,
      "originalJapaneseLine": "「それよりシィルちゃんの方が大変でしょ。",
      "translatedEnglishLine": "\"More than that, it must be harder for Shieru-chan."
    },
    {
      "lineNumber": 89704,
      "originalJapaneseLine": "　毎日この男のお守りじゃ」",
      "translatedEnglishLine": "Taking care of this guy every day.\""
    },
    {
      "lineNumber": 89705,
      "originalJapaneseLine": "「あはは……そんなことは……」",
      "translatedEnglishLine": "\"Ahaha... that’s not true...\""
    },
    {
      "lineNumber": 89706,
      "originalJapaneseLine": "「こら待て！",
      "translatedEnglishLine": "\"Hey, wait!"
    },
    {
      "lineNumber": 89707,
      "originalJapaneseLine": "　なんか俺に対する時と全然態度が違うぞ！」",
      "translatedEnglishLine": "Your attitude is totally different when it’s me!\""
    },
    {
      "lineNumber": 89708,
      "originalJapaneseLine": "「なんでシィルちゃんにまで",
      "translatedEnglishLine": "\"Why do you have to be on edge even with Shieru-chan?"
    },
    {
      "lineNumber": 89709,
      "originalJapaneseLine": "　ピリピリしないといけないのよ」",
      "translatedEnglishLine": "\""
    },
    {
      "lineNumber": 89710,
      "originalJapaneseLine": "「ひいきだ、ひいき。何故シィルにだけ……」",
      "translatedEnglishLine": "\"It’s favoritism, favoritism. Why only Shieru...\""
    },
    {
      "lineNumber": 89711,
      "originalJapaneseLine": "「違う。",
      "translatedEnglishLine": "\"No."
    },
    {
      "lineNumber": 89712,
      "originalJapaneseLine": "　あんたにだけ特別厳しいの」",
      "translatedEnglishLine": "I’m especially harsh only with you.\""
    },
    {
      "lineNumber": 89713,
      "originalJapaneseLine": "「あはは……」",
      "translatedEnglishLine": "\"Ahaha...\""
    },
    {
      "lineNumber": 89714,
      "originalJapaneseLine": "「ぐうっ……！」",
      "translatedEnglishLine": "\"Ugh...!\""
    },
    {
      "lineNumber": 89715,
      "originalJapaneseLine": "「ですから……",
      "translatedEnglishLine": "\"That’s why..."
    },
    {
      "lineNumber": 89716,
      "originalJapaneseLine": "　私はずっと以前から言っているんです。",
      "translatedEnglishLine": "I have been saying for a very long time."
    },
    {
      "lineNumber": 89717,
      "originalJapaneseLine": "　あんな方を信用すればどうなるか分からないと」",
      "translatedEnglishLine": "That if you trust someone like that, you don’t know what will happen.\""
    },
    {
      "lineNumber": 89718,
      "originalJapaneseLine": "「あー、んー……まーねー……」",
      "translatedEnglishLine": "\"Ah, hmm... well, yeah...\""
    },
    {
      "lineNumber": 89719,
      "originalJapaneseLine": "「それだというのに、",
      "translatedEnglishLine": "\"And yet,"
    },
    {
      "lineNumber": 89720,
      "originalJapaneseLine": "　上はいつもどうにかしてくれとばかり……」",
      "translatedEnglishLine": "Those above always just say ‘do something about it’...\""
    },
    {
      "lineNumber": 89721,
      "originalJapaneseLine": "「私も任務である以上、行えることは全てしますが、",
      "translatedEnglishLine": "\"As long as it’s my duty, I do everything I can,"
    },
    {
      "lineNumber": 89722,
      "originalJapaneseLine": "　しかし、あの人のお守りまでは面倒見切れは……」",
      "translatedEnglishLine": "But I just can’t keep taking care of that person...\""
    },
    {
      "lineNumber": 89723,
      "originalJapaneseLine": "「んー、はいはい……大変だ……」",
      "translatedEnglishLine": "\"Hmm, yeah, yeah... it’s tough...\""
    },
    {
      "lineNumber": 89724,
      "originalJapaneseLine": "アタゴの店、マカット酒場で",
      "translatedEnglishLine": "At Atago’s place, the Makatto Tavern,"
    },
    {
      "lineNumber": 89725,
      "originalJapaneseLine": "クリームが管を巻いていた。",
      "translatedEnglishLine": "Cream was whining."
    },
    {
      "lineNumber": 89726,
      "originalJapaneseLine": "「んっ、んっ、んっ……」",
      "translatedEnglishLine": "\"Nnh, nnnh, nnnh...\""
    },
    {
      "lineNumber": 89727,
      "originalJapaneseLine": "「ん、はあ……美味しい……」",
      "translatedEnglishLine": "\"Mmm, haah... delicious...\""
    },
    {
      "lineNumber": 89728,
      "originalJapaneseLine": "クリームが酒を一息で煽って、",
      "translatedEnglishLine": "Cream downed a drink in one gulp,"
    },
    {
      "lineNumber": 89729,
      "originalJapaneseLine": "熱っぽい溜め息を吐き出した。",
      "translatedEnglishLine": "and let out a feverish sigh."
    },
    {
      "lineNumber": 89730,
      "originalJapaneseLine": "「んー、そろそろお酒はその辺にしたら？」",
      "translatedEnglishLine": "\"Hmm, maybe you should stop drinking soon?\""
    },
    {
      "lineNumber": 89731,
      "originalJapaneseLine": "「ヘルマン人である私にとって、",
      "translatedEnglishLine": "\"For me, who is a Helman,"
    },
    {
      "lineNumber": 89732,
      "originalJapaneseLine": "　これくらいまだ飲み始めです」",
      "translatedEnglishLine": "this is just the beginning of drinking.\""
    },
    {
      "lineNumber": 89733,
      "originalJapaneseLine": "「でも、明日の仕事に差し支えるかも……」",
      "translatedEnglishLine": "\"But it might affect tomorrow’s work...\""
    },
    {
      "lineNumber": 89734,
      "originalJapaneseLine": "「……それもそうですね」",
      "translatedEnglishLine": "\"...That’s true.\""
    },
    {
      "lineNumber": 89735,
      "originalJapaneseLine": "「この後もまだ仕事がありますので、",
      "translatedEnglishLine": "\"I still have work to do after this,"
    },
    {
      "lineNumber": 89736,
      "originalJapaneseLine": "　そろそろおいとまします」",
      "translatedEnglishLine": "so I’ll be leaving soon.\""
    },
    {
      "lineNumber": 89737,
      "originalJapaneseLine": "「ヘルマン人、タフねぇ……」",
      "translatedEnglishLine": "\"Helmans are tough, huh...\""
    },
    {
      "lineNumber": 89738,
      "originalJapaneseLine": "「というわけで、",
      "translatedEnglishLine": "\"So,"
    },
    {
      "lineNumber": 89739,
      "originalJapaneseLine": "　すっかり自信をなくしてしまって……",
      "translatedEnglishLine": "I’ve completely lost my confidence..."
    },
    {
      "lineNumber": 89740,
      "originalJapaneseLine": "　うう……ぐすっ……」",
      "translatedEnglishLine": "Ugh... sob...\""
    },
    {
      "lineNumber": 89741,
      "originalJapaneseLine": "「あんた、話を聞く限り、",
      "translatedEnglishLine": "\"You, judging from what you’re saying,"
    },
    {
      "lineNumber": 89742,
      "originalJapaneseLine": "　はなから自信なんて欠片もないじゃない」",
      "translatedEnglishLine": "don’t have even a shred of confidence to begin with.\""
    },
    {
      "lineNumber": 89743,
      "originalJapaneseLine": "「うっ……」",
      "translatedEnglishLine": "\"Ugh...\""
    },
    {
      "lineNumber": 89744,
      "originalJapaneseLine": "「だったら失敗して元々、",
      "translatedEnglishLine": "\"Then if you fail, so what?"
    },
    {
      "lineNumber": 89745,
      "originalJapaneseLine": "　失うなんてもんないんだし、",
      "translatedEnglishLine": "You have nothing to lose,"
    },
    {
      "lineNumber": 89746,
      "originalJapaneseLine": "　もっと気楽にやってみれば？」",
      "translatedEnglishLine": "So why not try it more casually?\""
    },
    {
      "lineNumber": 89747,
      "originalJapaneseLine": "「あっ……」",
      "translatedEnglishLine": "\"Ah...\""
    },
    {
      "lineNumber": 89748,
      "originalJapaneseLine": "「そうかも……そうですね……」",
      "translatedEnglishLine": "\"That might be true... yes...\""
    },
    {
      "lineNumber": 89749,
      "originalJapaneseLine": "「あーーーのーーー男ーーー！」",
      "translatedEnglishLine": "\"Thaaat man!!!\""
    },
    {
      "lineNumber": 89750,
      "originalJapaneseLine": "「ぬぐぐぐ……いつか絶対に殺してくれるー！」",
      "translatedEnglishLine": "\"Ughggh... I’ll definitely kill you someday!\""
    }
  ]
}

